import urllib.parse
from typing import Annotated
from fastapi import FastAPI, File, Form, UploadFile
from fastapi.responses import Response, JSONResponse
import base64
import fitz

app = FastAPI()


# Test gui file -> bi loi font tieng viet
@app.post("/process")
def get_model(file: UploadFile):
    with open(f"source_files/{file.filename}", "rb") as f:
        pdf_bytes = f.read()
    headers = {"macongviec": "Mã công việc",
               "donvichucchi": "Đơn vị công việc",
               "noidungcongviec": "Nội dung công việc",
               "sanpham": "Sản phẩm",
               "phutrach": "Phụ trách",
               "thuchien": "Thực hiện",
               "phoihop": "Phối hợp",
               "thuchanh": "Phối hợp",
               "quada": "Phối hợp",
               "Content-Disposition": "attachment",
               "filename": "out.pdf",
               "charset": "UTF-8"
               }

    response = Response(pdf_bytes, media_type="application/json", headers=headers)
    return response


# Test chi return ve response tieng viet -> van loi


@app.post("/login/")
async def login(file: Annotated[bytes, File()],
                fileb: Annotated[UploadFile, File()],
                token: Annotated[str, Form()], ):
    with open(f"source_files/{fileb.filename}", "rb") as f:
        pdf_bytes = f.read()
    return {"file_size": len(file),
            "token": token,
            "file_byte": pdf_bytes
            }


@app.get("/job")
def get_job_content():
    # Set the response header with content type and charset
    response = JSONResponse(content="headers", media_type="application/json; charset=UTF-8")
    headers = {
        "macongviec": "Giá trị",
        "noidungcongviec": "Tên",
        "charset": "UTF-8",
        "response": response
    }
    # Return the job content with the specified headers
    return headers


@app.post("/files")
async def create_file(
        fileb: Annotated[UploadFile, File()],
        token: Annotated[str, Form()],
):
    # Read the contents of the 'fileb' parameter
    return {
        "token": token,
        "fileb_content_type": fileb.content_type
    }


@app.post("/upload")
def upload(file: UploadFile = File(...)):
    pdf_content_pdf = base64.b64encode(file.file.read()).decode()
    result = {"header": {
                "macongviec":"Mã công việc",
                "donvichucchi": "Đơn vị công việc",
                "noidungcongviec": "Nội dung công việc",
                "sanpham": "Sản phẩm",
                "phutrach": "Phụ trách",
                "thuchien": "Thực hiện",
                "phoihop": "Phối hợp",
            },
            "content": pdf_content_pdf
            }
    print(result.get("header"))
    process(result.get("content"))
    return result

def process(content):
    pdf_bytes = base64.b64decode(content)
    f = open("demofile3.pdf", "wb")
    f.write(pdf_bytes)
    f.close()

def main():
    str = ""
    pdf_bytes = base64.b64decode(str)
    f = open("demofile4.pdf", "wb")
    f.write(pdf_bytes)
    f.close()

if __name__ == "main":
    main()

